import{_ as a,c as e,o as t,a2 as r}from"./chunks/framework.Ja7AKUN6.js";const b=JSON.parse('{"title":"2025 年 12 月更新：新年，新活动","description":"","frontmatter":{"title":"2025 年 12 月更新：新年，新活动","contributors":["gtxykn0504","Xiaozonglin"],"date":"2025-12-01T00:00:00.000Z","updated":"2025-12-01T00:00:00.000Z","categories":"博客更新","tags":["总结","活动"]},"headers":[],"relativePath":"blog/202512.md","filePath":"blog/202512.md"}'),o={name:"blog/202512.md"},n=r('<h1 id="_2025-年-12-月更新-新年-新活动" tabindex="-1">2025 年 12 月更新：新年，新活动 <a class="header-anchor" href="#_2025-年-12-月更新-新年-新活动" aria-label="Permalink to &quot;2025 年 12 月更新：新年，新活动&quot;">​</a></h1><h2 id="_2025年项目组总结" tabindex="-1">2025年项目组总结 <a class="header-anchor" href="#_2025年项目组总结" aria-label="Permalink to &quot;2025年项目组总结&quot;">​</a></h2><p>不知不觉间，2025 年已来到 12 月。这一年，「开往 Travellings」迎来了第五个年头，就像一个慢慢长大的小孩，在犯错中不断成长，在摸索中不断进步。</p><p>回望 2025 年，这是维护组责任与挑战并存的一年。3 月初，为保护站长的个人信息权益，项目组编写了《隐私政策》；5 月，社区内出现争议事件，暴露出项目组在政策层面存在漏洞，对此我们对新维护组成员加入流程进行规范，让新维护组成员在加入前充分了解维护组情况，同时重写《运维规定》，从制度上降低未来发生类似纠纷的可能性；7 月，我们完成了对网站标签的同步以及成员文章的订阅与整理工作，进一步提升用户使用体验；8 月，项目先后遭遇仓库误删、QQ 社群封禁两起事故，还面临了网络流量攻击的挑战，面对这些突发状况，维护组通过规范仓库管理权限、管控消息转发、新增跳转页面备用源等举措，增强了项目稳定性。</p><p>我们深知当前项目仍有不足，真诚欢迎大家提出宝贵建议，共同推动项目朝着更透明、有序的方向发展。</p><h2 id="新年活动" tabindex="-1">新年活动 <a class="header-anchor" href="#新年活动" aria-label="Permalink to &quot;新年活动&quot;">​</a></h2><p>岁末将至，年味渐浓。为共同庆祝新年，我们特别开放了新年庆祝网站。在网站留言板上，大家可以写下新年祝福，分享自己过去一年里的收获和成就，也可以记录对未来的美好期待。与此同时，我们还设计了解谜游戏，游戏有数个关卡，不同关卡彼此独立，在活动过程中维护组将不定时发布新的关卡。我们鼓励各位在彼此乐意、不直接透露答案的前提下交流题目做法，预祝各位玩得开心。</p><blockquote><p>地址：<a href="https://happy-newyear.travellings.cn/" target="_blank" rel="noreferrer">https://happy-newyear.travellings.cn/</a></p></blockquote>',8),l=[n];function s(i,_,c,p,h,d){return t(),e("div",null,l)}const f=a(o,[["render",s]]);export{b as __pageData,f as default};
